import React, { Component } from 'react';
import './Table';
class Table extends React.Component {
  render() {
    const items = this.props.items;
    return (
      <div >
        <table id="customers">
          <tbody>
            <tr>
              <th>Username</th>
              <th>Password</th>
              <th>Phone</th>
              <th>StartDate</th>
              <th>EndDate</th>
              <th>Action</th>
              
            </tr>
            {items.map(item => {
              return (
                <tr>
                  <td>{item.username}</td>
                  <td>{item.password}</td>
                  <td>{item.phone}</td>
                  <td>{item.startDate}</td>
                  <td>{item.endDate}</td>
                  <td>{item.action}</td>
                </tr>
              );
            })}
          </tbody>
        </table>
      </div>
    );
  }
}

export default Table;
